  `sg_name` varchar(16) NOT NULL DEFAULT '' COMMENT '角色名称',
  `privilege_level` tinyint(1) NOT NULL DEFAULT 2 COMMENT '后台角色权限级别置位，一位前台权限、二位后台权限',
